import React, { Component } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import "./header.css";

export class Header extends Component {
  constructor() {
    super();
    this.state = {
      toggleNav: false
    };
  }
  render() {
    console.log(this.props.userObj.admin);
    return (
      <div className="header">
        <div>
          <img
            src="https://placeholder.com/wp-content/uploads/2018/10/placeholder.com-logo3.jpg"
            alt="logo"
          />
          <button><div className="bar"></div></button>
          <ol>
            <div>
              <li>
                <Link to="/">Home</Link>
              </li>
            </div>
            {this.props.userObj.user.length === 0 ? (
              <div>
                <li>
                  <Link to="/register">Register</Link>
                </li>
              </div>
            ) : null}
            {this.props.userObj.user.length !== 0 ? (
              <div>
                <li>
                  <Link to="/blogs">Blogs</Link>
                </li>
                <li>
                  <Link to="/about">About</Link>
                </li>
                <li>
                  <Link to="/contact">Contact</Link>
                </li>
                <li>
                  <Link to="/stripe">Donate</Link>
                </li>
              </div>
            ) : null}
            {this.props.userObj.admin === true ? (
              <div>
                <li>
                  <Link to="/dashboard/clients">Admin</Link>
                </li>
              </div>
            ) : null}
          </ol>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    userObj: state
  };
};

export default connect(mapStateToProps)(Header);
